contracts/11_mapping2.sol.content:
//SPDX-License-Identifier:GPL-3.0
pragma solidity >=0.5 <0.9;
contract myMapping {
    mapping (address => uint) addressbalance;
    uint public recevieValue;
    function recieve() public payable {
        addressbalance[msg.sender] = msg.value;
    }
    function getBalance () public view returns (uint){
        return address(this).balance;
    }
    function send(address payable _to, uint _amount) public {
        require(addressbalance[msg.sender] >= _amount, "not enough funds");
    }
}

